import React from "react";

const CourseRow = ({ course }) => (
  <div class="row border justify-content-between">
    <div class="col-6">

        {course.name}
    </div>
    <div class="d-none d-sm-block col-2 text-center">{course.owner}</div>
    <div class="d-none d-sm-block col-2 text-center">{course.modifiedDate}</div>
    <div class="col-2 text-right">X</div>
  </div>
);

export default CourseRow;
